import React , {useEffect} from 'react'
import {Table  ,Row ,Container , Col ,Button ,ButtonGroup ,Form, Navbar} from "react-bootstrap"
import {useDispatch, useSelector} from 'react-redux';
import { loadWorkers } from '../redux/actions';
import 'bootstrap/dist/css/bootstrap.min.css';


const Workers= ()=>{
    const dispatch = useDispatch();
    const {Workers} = useSelector(state => state.data);
 useEffect(() => {
 dispatch(loadWorkers());
 },[]);

 return (
    <>
    <Container>
        <Row>
            <Col md ={4}>Form</Col>
            <Col md ={8}>
             <Table boarded hover>
                 <thead>
                     <tr>No.</tr>
                     <tr>Name</tr>
                     <tr>Email</tr>
                     <tr>PhoneNumber</tr>
                     <tr>Age</tr>

                 </thead>

             </Table>
            </Col>
        </Row>
    </Container>
    </>
 );
};

export default Workers
